import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState([]);
  const getUsers = async () => {
    const res = await fetch('https://api.pokemontcg.io/v2/cards?page=1&pageSize=10');
    setData(await res.json());
    console.log(data);
  }
  useEffect(() => {
    getUsers();
  }, []);

  return (
    <div className="App">

      {
        data.map((user) => {
          return (
            <div>
              {user.id}
            </div>
          )
        })
      }
    </div>
  );
}

export default App;
